import React, {Component} from "react"

import PrikazProjekcija from "./PrikazProjekcija"
import FilterProjekcija from "./FilterProjekcija"

import $ from "jquery"

class Projekcije extends Component{

    constructor(){
        super()
        this.state = {
            projekcije:[],
            saleZaIzbor:[],
            tipoviZaIzbor:["2D", "3D", "4D"],
            tipProjekcije:"",
            sala:""
        }
    }

    componentDidMount(){
        const conf={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/projekcije',conf)
            .then(res => res.json())
            .then(response => {
                this.setState({
                    projekcije: response
            })
        })
    }

    filter(){

        const config={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        const idFilm=$('#idFilm').val() === "" ? "null":$('#idFilm').val();
        const idDatumOd=$('#idDatumOd').val() === "" ? "null":$('#idDatumOd').val();
        const idDatumDo=$('#idDatumDo').val() === "" ? "null":$('#idDatumDo').val();
        const idTip=$('#idTip').val() === "" ? "null":$('#idTip').val();
        const idSala=$('#idSala').val() === "" ? "null":$('#idSala').val();
        const idCenaOd=$('#idCenaOd').val() === "" ? "null":$('#idCenaOd').val();
        const idCenaDo=$('#idCenaDo').val() === "" ? "null":$('#idCenaDo').val();
        const sort=$('#idSortProjekcije').val() === "" ? "null":$('#idSortFilmovi').val();

        fetch('http://localhost:8080/bioskop/projekcije/'+idFilm+"/"+idDatumOd+"/"+idDatumDo+"/"+idTip+"/"+idSala+"/"+idCenaOd+"/"+idCenaDo+"/"+sort,config)
            .then(res => res.json())
            .then(res => {
                this.setState({
                    projekcije: res
                })
            })
    }

    render(){
        const prikaz=this.state.projekcije.map(p => <PrikazProjekcija key={p.id} projekcija={p} />)
        /*const prikazFilma=this.state.film !== "" && <Film state={this.props.state} cancel={this.cancel} editFilm={this.editFilm} deleteFilm={this.deleteFilm} film={this.state.film} />
        const editFilma=this.state.editFilm !== "" && <EditFilm handleSubmit={this.handleSubmit} 
                                                        cancel={this.cancel} handleChange={this.handleChange} 
                                                        film={this.state.editFilm} />*/

        return(
            <div id="idProjekcije">
                <table id="tableProjekcije" border="1">
                    <FilterProjekcija state={this.state} filter={this.filter} />
                    {prikaz}
                </table>
            </div>
        )
    }
}

export default Projekcije
